import{_ as t}from"./chunks/data_upload.07d0010e.js";import{_ as a,a as e}from"./chunks/attr_formula.664c8ff4.js";import{_ as o,o as s,c as n,Q as l}from"./chunks/framework.6e0d310a.js";const r="/teamone/img/functions/teamone_formula.png",i="/teamone/img/functions/quite_mode.png",m="/teamone/img/functions/default_elements.png",u="/teamone/img/functions/alternative_hierarchy.png",c="/teamone/img/functions/teamone_formula_insert.png",d="/teamone/img/functions/subset_formula.png",x=JSON.parse('{"title":"TeamOne","titleTemplate":"Formulas","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"Formulas"},"headers":[],"relativePath":"doc/formulas.md","filePath":"doc/formulas.md"}'),p={name:"doc/formulas.md"},h=l('<h1 id="formulas" tabindex="-1">Formulas <a class="header-anchor" href="#formulas" aria-label="Permalink to &quot;Formulas&quot;">​</a></h1><h2 id="teamone-function" tabindex="-1">TEAMONE() function <a class="header-anchor" href="#teamone-function" aria-label="Permalink to &quot;TEAMONE() function&quot;">​</a></h2><p><em><strong>TEAMONE()</strong></em> function is a simple formula approach to retrieve data from IBM Planning Analytics. It expects the following arguments:</p><ul><li><em><strong>cubeName</strong></em> - the cube name to retrieve data from</li><li><em><strong>rangeRows</strong></em> - select the cells represeting your rows</li><li><em><strong>rangeColumns</strong></em> - select the cells represeting your columns</li><li><em><strong>rangeTitles</strong></em> - select the cells represeting your context elements</li><li><em><strong>options</strong></em> - flags to &quot;A&quot;utofit columns, use &quot;F&quot;ormatted values, allow &quot;U&quot;pdates, use &quot;S&quot;tatic values, &quot;R&quot;everse sign, &quot;Q&quot;uiet mode. You can combine flags: &quot;AFSQ&quot; - fetch formatted static values, autofit columns and quite mode.</li><li><em><strong>solveOrder</strong></em> - specifies the formula evaluation order. If omitted, the default value of 0 will be used.</li></ul><p><img src="'+r+`" alt="img" data-zoomable=""></p><p>For rows and columns you can select multiple cells, a single cell or even no cells (use an empty string or leave the argument empty):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">// Retrieve data from Revenue cube, use formatted values and autofit columns</span></span>
<span class="line"><span style="color:#e1e4e8;">=TEAMONE(&quot;Revenue&quot;, A4:A5, B2:C3, A2:A3,&quot;AF&quot;)</span></span>
<span class="line"><span style="color:#e1e4e8;"></span></span>
<span class="line"><span style="color:#e1e4e8;">// No columns (argument #3 is skipped), hardcoded title element</span></span>
<span class="line"><span style="color:#e1e4e8;">=TEAMONE(&quot;Revenue&quot;, A4:A5, , &#39;Gross Revenue&#39;)</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">// Retrieve data from Revenue cube, use formatted values and autofit columns</span></span>
<span class="line"><span style="color:#24292e;">=TEAMONE(&quot;Revenue&quot;, A4:A5, B2:C3, A2:A3,&quot;AF&quot;)</span></span>
<span class="line"><span style="color:#24292e;"></span></span>
<span class="line"><span style="color:#24292e;">// No columns (argument #3 is skipped), hardcoded title element</span></span>
<span class="line"><span style="color:#24292e;">=TEAMONE(&quot;Revenue&quot;, A4:A5, , &#39;Gross Revenue&#39;)</span></span></code></pre></div><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=0" target="_blank" rel="noreferrer">=TEAMONE() formula example</a></p><h2 id="autofit-columns" tabindex="-1">Autofit columns <a class="header-anchor" href="#autofit-columns" aria-label="Permalink to &quot;Autofit columns&quot;">​</a></h2><p>Use the &quot;A&quot; flag in the TEAMONE() function to automatically resizes columns to fit the cell in each column that has the widest content.</p><h2 id="formatted-values" tabindex="-1">Formatted values <a class="header-anchor" href="#formatted-values" aria-label="Permalink to &quot;Formatted values&quot;">​</a></h2><p>Use the &quot;F&quot; flag in the TEAMONE() function to retrieve formatted cube values from IBM Planning Analytics. Alternatively, you can skip this flag and apply formatting in Google Sheets.</p><h2 id="static-values" tabindex="-1">Static values <a class="header-anchor" href="#static-values" aria-label="Permalink to &quot;Static values&quot;">​</a></h2><p>When using the &quot;S&quot; flag, =TEAMONE() formula will return a single value (the very first one) and the rest of the values will be printed as static. This flag is recommended when you need to use the TEAMONE() formula with hundreds of rows and/or columns to avoid the error message <em><strong>You have exceeded the property storage quota. Please remove some properties and try again</strong></em>. However, in most cases, you will not need to use this flag.</p><h2 id="update-mode" tabindex="-1">Update mode <a class="header-anchor" href="#update-mode" aria-label="Permalink to &quot;Update mode&quot;">​</a></h2><p>Use the &quot;U&quot; flag in TEAMONE() to enable data updates. The &quot;U&quot; flag also turns on the static values described above. You can submit the formulas data to IBM Planning Analytics using the <a href="./functions.html#upload-data">upload data</a> button available on the content tab.</p><p><img src="`+t+'" alt="img" data-zoomable=""></p><h2 id="quiet-mode" tabindex="-1">Quiet mode <a class="header-anchor" href="#quiet-mode" aria-label="Permalink to &quot;Quiet mode&quot;">​</a></h2><p>If you skip some cube dimensions, TeamOne will automatically use <em><strong>default elements</strong></em> for those dimensions and will add them to the cell notes. Use the &quot;Q&quot; flag in the TEAMONE() function to disable notes with omitted dimensions.</p><p><img src="'+i+'" alt="img" data-zoomable=""></p><h2 id="repetitive-elements" tabindex="-1">Repetitive elements <a class="header-anchor" href="#repetitive-elements" aria-label="Permalink to &quot;Repetitive elements&quot;">​</a></h2><p>If you have multiple rows and/or columns, you don&#39;t have to specify repetitive elements for each row or column. TeamOne will automatically use the same element name if the next rows/columns are blank.</p><p><img src="'+a+'" alt="img" data-zoomable=""></p><h2 id="multiple-formulas-performance" tabindex="-1">Multiple formulas performance <a class="header-anchor" href="#multiple-formulas-performance" aria-label="Permalink to &quot;Multiple formulas performance&quot;">​</a></h2><p>If using the same title elements, the same row\\column dimensions and the same formula flags, TeamOne will automatically detect and build a single query for each group of similar formulas, resulting in better performance.</p><h2 id="solve-order" tabindex="-1">Solve order <a class="header-anchor" href="#solve-order" aria-label="Permalink to &quot;Solve order&quot;">​</a></h2><p>If you need to use the results of <em><strong>TEAMONE()</strong></em> or <em><strong>ATTR()</strong></em> functions as the arguments for another <em><strong>TEAMONE()</strong></em> or <em><strong>ATTR()</strong></em> function, you can specify the <em><strong>solveOrder</strong></em> to control the order in which those results will be recalculated. <em><strong>solveOrder</strong></em> must be 1 or greater. To use the results of the functions <em><strong>TEAMONE()</strong></em> or <em><strong>ATTR()</strong></em> as arguments for another <em><strong>TEAMONE()</strong></em> or <em><strong>ATTR()</strong></em> function, you can specify the <em><strong>solveOrder</strong></em> to control the order in which those results will be recalculated. The <em><strong>solveOrder</strong></em> value should be 1 or greater. If omitted, the default value of 0 will be used.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>It is recommended to use the same <em>solveOrder</em> value for multiple formulas that can be recalculated at the same time, as using multiple different values might increase the time taken to recalculate all formulas.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For both <em>=TEAMONE()</em> and <em>=ATTR()</em> functions, you can totally skip the <em>options</em> argument before specifying the <em>solveOrder</em> value, for example: =ATTR(&#39;product&#39;,&#39;21002&#39;,&#39;Product Color&#39;,2)</p></div><h2 id="default-elements" tabindex="-1">Default elements <a class="header-anchor" href="#default-elements" aria-label="Permalink to &quot;Default elements&quot;">​</a></h2><p>You do not need to include elements from all the cube dimensions. TeamOne will automatically select the default member for each skipped dimension and add a corresponding note to the cell. Use <a href="#quiet-mode">quiet mode</a> option to suppress notes.</p><p><img src="'+m+'" alt="img" data-zoomable=""></p><h2 id="alternative-hierarhies" tabindex="-1">Alternative hierarhies <a class="header-anchor" href="#alternative-hierarhies" aria-label="Permalink to &quot;Alternative hierarhies&quot;">​</a></h2><p>Use the <em><strong>dimension^hierarchy^element</strong></em> syntax to specify the dimension and hierarchy for any title element or the first element of any row\\column range. This is especially helpful when an element name is ambiguous (exists in multiple dimensions).</p><p><img src="'+u+`" alt="img" data-zoomable=""></p><h2 id="connection-name" tabindex="-1">Connection name <a class="header-anchor" href="#connection-name" aria-label="Permalink to &quot;Connection name&quot;">​</a></h2><p>Use &quot;ConnectionName:CubeName&quot; syntax to retrieve data from the specified connection.</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">// Revenue cube in TeamOneTest environment</span></span>
<span class="line"><span style="color:#e1e4e8;">=TEAMONE(&quot;TeamOneTest:Revenue&quot;, A4:A5, B2:C3, A2:A3)</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">// Revenue cube in TeamOneTest environment</span></span>
<span class="line"><span style="color:#24292e;">=TEAMONE(&quot;TeamOneTest:Revenue&quot;, A4:A5, B2:C3, A2:A3)</span></span></code></pre></div><h2 id="create-formulas-automatically" tabindex="-1">Create formulas automatically <a class="header-anchor" href="#create-formulas-automatically" aria-label="Permalink to &quot;Create formulas automatically&quot;">​</a></h2><p>You can let TeamOne build (autogenerate) <em>=TEAMONE()</em> formula for you using an existing cube/view on the <em>Model</em> tab or from the exploration menu:</p><p><img src="`+c+'" alt="img" data-zoomable=""></p><h2 id="attr-function" tabindex="-1">ATTR() function <a class="header-anchor" href="#attr-function" aria-label="Permalink to &quot;ATTR() function&quot;">​</a></h2><p><em><strong>ATTR()</strong></em> function retrieves the specified attribute value for the specified elements. It expects the following arguments:</p><ul><li><em><strong>dimName</strong></em> - the dimension name, you can also use <em>dimName:hierName</em> syntax to specify an alternative hierarchy</li><li><em><strong>rangeElements</strong></em> - select the cells represeting your elements</li><li><em><strong>attrName</strong></em> - attribute name, i.e. &#39;Caption&#39;</li><li><em><strong>options</strong></em> - flag, &quot;S&quot; - static values.</li><li><em><strong>solveOrder</strong></em> - specifies the formula evaluation order. If omitted, the default value of 0 will be used.</li></ul><p><img src="'+e+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=1901571147" target="_blank" rel="noreferrer">=ATTR() formula example</a></p><h2 id="dimension-name" tabindex="-1">Dimension name <a class="header-anchor" href="#dimension-name" aria-label="Permalink to &quot;Dimension name&quot;">​</a></h2><p>To specify a dimension name, simply enter the name. Alternatively, you can use the syntax <em>dimName:hierName</em> to specify an alternative hierarchy.</p><h2 id="element-range" tabindex="-1">Element range <a class="header-anchor" href="#element-range" aria-label="Permalink to &quot;Element range&quot;">​</a></h2><p>Select cells in a spreadsheet, you can choose a single cell, or a range of multiple horizontal or vertical cells. TeamOne will ignore any empty cells that are included in the range.</p><p><img src="'+e+'" alt="img" data-zoomable=""></p><h2 id="subset-function" tabindex="-1">SUBSET() function <a class="header-anchor" href="#subset-function" aria-label="Permalink to &quot;SUBSET() function&quot;">​</a></h2><p><em><strong>SUBSET()</strong></em> function retrieves the dimension elements using the set expression. It expects the following arguments:</p><ul><li><em><strong>dimName</strong></em> - the dimension name, you can also use <em>dimName:hierName</em> syntax to specify an alternative hierarchy</li><li><em><strong>setExpression</strong></em> - a valid MDX expression, $SubsetName or <a href="./functions.html#mdx-mods"><em><strong>MDX mods</strong></em></a></li><li><em><strong>attrName</strong></em> - attribute name, i.e. &#39;Caption&#39;</li><li><em><strong>options</strong></em> - flag, &quot;S&quot; - static values.</li><li><em><strong>solveOrder</strong></em> - specifies the formula evaluation order. If omitted, the default value of 0 will be used.</li></ul><p><img src="'+d+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=557987930" target="_blank" rel="noreferrer">=SUBSET() formula example</a></p><h2 id="set-expression" tabindex="-1">Set expression <a class="header-anchor" href="#set-expression" aria-label="Permalink to &quot;Set expression&quot;">​</a></h2><p>You can provide a valid MDX expression or use TeamOne subset syntax:</p><ul><li>a semicolon delimited element list, i.e.: <em>Jan;Feb;Mar</em></li><li>a pattern using &quot;*&quot; (any characters) and &quot;?&quot; (any one character), i.e.: <em>/*substring*/</em> or <em>/FY202? */</em></li><li>a subset name after a dollar character, i.e. <em>$My subset name</em></li><li>a subset <a href="./functions.html#subset-keywords">keyword</a>, i.e.: <em>$LEAVES</em></li></ul><p>You can also combine elements, patterns, MDX expressions, <a href="./functions.html#subset-keywords">subset keywords</a> and <a href="./functions.html#mdx-mods">MDX mods</a> into a semicolon delimited list, i.e.: <em>{[month].[Q1].children};/FY202*/&gt;&gt;sortasc</em></p><p><img src="'+e+'" alt="img" data-zoomable=""></p>',61),f=[h];function g(b,v,q,y,T,A){return s(),n("div",null,f)}const O=o(p,[["render",g]]);export{x as __pageData,O as default};
